import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';

function Register() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [fullName, setFullName] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();
  const { register } = useAuth();

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      await register(email, password, fullName);
      alert('ðŸŽ‰ Registration successful! Please login.');
      navigate('/login');
    } catch (err) {
      setError(err.response?.data?.detail || 'Registration failed');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={styles.container}>
      {/* Animated floating shapes */}
      <div style={styles.shape1}></div>
      <div style={styles.shape2}></div>
      <div style={styles.shape3}></div>
      
      <div style={styles.card}>
        <div style={styles.iconContainer}>
          <div style={styles.icon}>âœ¨</div>
        </div>
        
        <h1 style={styles.title}>Join Us Today</h1>
        <p style={styles.tagline}>Start creating amazing documents with AI</p>
        
        {error && <div style={styles.error}>{error}</div>}
        
        <form onSubmit={handleSubmit} style={styles.form}>
          <div style={styles.inputGroup}>
            <label style={styles.label}>Full Name</label>
            <input
              type="text"
              value={fullName}
              onChange={(e) => setFullName(e.target.value)}
              style={styles.input}
              placeholder="John Doe"
              required
            />
          </div>
          
          <div style={styles.inputGroup}>
            <label style={styles.label}>Email Address</label>
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              style={styles.input}
              placeholder="you@example.com"
              required
            />
          </div>
          
          <div style={styles.inputGroup}>
            <label style={styles.label}>Password</label>
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              style={styles.input}
              placeholder="â€¢â€¢â€¢â€¢â€¢â€¢â€¢â€¢"
              required
            />
          </div>
          
          <button type="submit" style={styles.button} disabled={loading}>
            {loading ? 'ðŸ”„ Creating account...' : 'ðŸš€ Create Account'}
          </button>
        </form>
        
        <p style={styles.link}>
          Already have an account? <Link to="/login" style={styles.linkText}>Login here</Link>
        </p>
      </div>
      
      <style>{keyframes}</style>
    </div>
  );
}

const keyframes = `
  @keyframes float {
    0%, 100% { transform: translateY(0px) rotate(0deg); }
    50% { transform: translateY(-20px) rotate(5deg); }
  }
  
  @keyframes float2 {
    0%, 100% { transform: translateY(0px) rotate(0deg); }
    50% { transform: translateY(-30px) rotate(-5deg); }
  }
  
  @keyframes float3 {
    0%, 100% { transform: translateY(0px) scale(1); }
    50% { transform: translateY(-15px) scale(1.05); }
  }
  
  @keyframes fadeInUp {
    from {
      opacity: 0;
      transform: translateY(30px);
    }
    to {
      opacity: 1;
      transform: translateY(0);
    }
  }
  
  @keyframes pulse {
    0%, 100% { transform: scale(1); }
    50% { transform: scale(1.05); }
  }
`;

const styles = {
  container: {
    minHeight: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    background: 'linear-gradient(135deg, #FFF8DC 0%, #FFE4B5 50%, #FFDAB9 100%)',
    position: 'relative',
    overflow: 'hidden',
  },
  shape1: {
    position: 'absolute',
    width: '300px',
    height: '300px',
    background: 'linear-gradient(135deg, rgba(230, 230, 250, 0.3), rgba(216, 191, 216, 0.3))',
    borderRadius: '50%',
    top: '-100px',
    left: '-100px',
    animation: 'float 6s ease-in-out infinite',
  },
  shape2: {
    position: 'absolute',
    width: '200px',
    height: '200px',
    background: 'linear-gradient(135deg, rgba(221, 160, 221, 0.3), rgba(238, 130, 238, 0.3))',
    borderRadius: '50%',
    bottom: '-50px',
    right: '-50px',
    animation: 'float2 8s ease-in-out infinite',
  },
  shape3: {
    position: 'absolute',
    width: '150px',
    height: '150px',
    background: 'linear-gradient(135deg, rgba(230, 230, 250, 0.4), rgba(221, 160, 221, 0.4))',
    borderRadius: '30% 70% 70% 30% / 30% 30% 70% 70%',
    top: '50%',
    right: '10%',
    animation: 'float3 7s ease-in-out infinite',
  },
  card: {
    backgroundColor: 'white',
    padding: '50px 40px',
    borderRadius: '20px',
    boxShadow: '0 20px 60px rgba(0,0,0,0.15)',
    width: '100%',
    maxWidth: '450px',
    position: 'relative',
    zIndex: 1,
    animation: 'fadeInUp 0.6s ease-out',
  },
  iconContainer: {
    textAlign: 'center',
    marginBottom: '20px',
  },
  icon: {
    fontSize: '60px',
    animation: 'pulse 2s ease-in-out infinite',
  },
  title: {
    textAlign: 'center',
    background: 'linear-gradient(135deg, #9370DB, #BA55D3)',
    WebkitBackgroundClip: 'text',
    WebkitTextFillColor: 'transparent',
    marginBottom: '10px',
    fontSize: '32px',
  },
  tagline: {
    textAlign: 'center',
    color: '#9370DB',
    marginBottom: '30px',
    fontSize: '14px',
    fontStyle: 'italic',
  },
  form: {
    display: 'flex',
    flexDirection: 'column',
    gap: '20px',
  },
  inputGroup: {
    display: 'flex',
    flexDirection: 'column',
  },
  label: {
    marginBottom: '8px',
    fontWeight: '600',
    color: '#6B5B95',
    fontSize: '14px',
  },
  input: {
    padding: '14px 16px',
    border: '2px solid #E6E6FA',
    borderRadius: '12px',
    fontSize: '16px',
    transition: 'all 0.3s ease',
    outline: 'none',
  },
  button: {
    padding: '16px',
    background: 'linear-gradient(135deg, #9370DB, #BA55D3)',
    color: 'white',
    border: 'none',
    borderRadius: '12px',
    fontSize: '16px',
    cursor: 'pointer',
    fontWeight: '600',
    transition: 'transform 0.2s ease, box-shadow 0.2s ease',
    marginTop: '10px',
  },
  error: {
    padding: '12px',
    backgroundColor: '#FFE4E4',
    color: '#D8000C',
    borderRadius: '10px',
    marginBottom: '20px',
    fontSize: '14px',
    textAlign: 'center',
  },
  link: {
    textAlign: 'center',
    marginTop: '25px',
    color: '#666',
    fontSize: '14px',
  },
  linkText: {
    color: '#9370DB',
    fontWeight: '600',
    textDecoration: 'none',
  },
};

export default Register;
